import React from 'react';
import Link from 'next/link'


const Navigation = () => {  
    return(
        <nav>
        <ul>
            <li>
                <Link href='/'><a>Home</a></Link>
            </li>
            <li>
                <Link href='/about'><a>Personajes de Rick y Morty</a></Link>
            </li>
        </ul>
        </nav>
    )
}
export default Navigation;
